          </Box>
      </Box>
      <Divider/>
      <Box className="carousel" sx={{width:"80vw"}}>
          <Box
                component="img"
                sx={{
                  width: "600px",
                  height: "600px"
                }}
                alt="The house from the offer."
                src={jewelery1}
                />
          <Box
                component="img"
                sx={{
                  width: "600px",
                  height: "600px"
                }}
                alt="The house from the offer."
                src={jewelery6}
                />
                <Box
                component="img"
                sx={{
                  width: "600px",
                  height: "600px"
                }}
                alt="The house from the offer."
                src={jewelery2}
                />
                <Box
                component="img"
                sx={{
                  width: "600px",
                  height: "600px"
                }}
                alt="The house from the offer."
                src={jewelery3}
                />
                <Box
                component="img"
                sx={{
                  width: "600px",
                  height: "600px"
                }}
                alt="The house from the offer."
                src={jewelery4}
                />
        </Box>
      </Box>

  )
}

export default LandingPage
